INSERT INTO `qb_reply` VALUES ('665','','0','684','49','1','1','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;剖分式球面滚子轴承是在不拆除轴上其他零件时，能方便迅速地安装轴承，能够缩短维修周期一半以上，降低维修费用50%。该轴承经过特殊设计，工作阻力小，运转平稳可靠，工作温度可达到180℃，非常适合低速、重载等工况条件比较恶劣的场合使用。&nbsp;剖分轴承常用于转炉支承、连铸辊支承、大型输运设备等拆卸条件受限制的应用场合，用于替代原先的整体式轴承。<br /></p><table style=\"width:537px;border-collapse:collapse\" width=\"537\" height=\"589\"><colgroup><col width=\"126\" /><col width=\"78\" /><col width=\"42\" /><col width=\"36\" /><col width=\"25\" /><col width=\"47\" /><col width=\"54\" /><col width=\"59\" /><col width=\"70\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:126px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et2\" height=\"38\" rowspan=\"2\" width=\"126\">型号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:78px;white-space:normal;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"78\">&nbsp;疲劳载荷极限值</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:145px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et2\" height=\"19\" width=\"145\" colspan=\"4\">外形尺寸(mm)</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:108px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et2\" height=\"19\" width=\"108\" colspan=\"2\">基本负