INSERT INTO `qb_reply` VALUES ('668','','0','687','53','1','1','<p>&nbsp;&nbsp;&nbsp;&nbsp;单列圆锥滚子轴承主要用于承受径向载荷为主的径向与轴向联合载荷，而大锥角圆锥滚子轴承（27°～30°），能承受以轴向为主的联合载荷，但一般不宜承受纯轴向载荷。&nbsp;单列圆锥滚子轴承在安装和使用过程中，可任意调整径、轴向游隙，也可以采用预过盈安装以增大轴承刚性。圆锥滚子轴承游隙的大小直接影响轴承的工作性能。当游隙过小时，温升较高；当游隙过大时，振动加大，旋转精度也难以保证。因此，在安装和使用过程中，要特别注意调整轴承的游隙。&nbsp;为了防止滚子与滚道接触处产生应力集中，造成轴承过早损坏，安装时不允许轴相对于外壳孔有倾斜，只有当滚子与滚道母线之间为修正线接触时，才能允许有微量（≤2′）的倾斜。由于在径向载荷作用下将产生有附加作用力，因此，一般在轴的两个支承中安装两套单列圆锥滚子轴承，使轴承的内圈和外圈同名端面相对。&nbsp;圆锥滚子轴承多用于汽车后桥轮毂、大型机床主轴、大功率减速器、输送装置的滚轮等。</p><table style=\"width:626px;border-collapse:collapse\" width=\"626\" height=\"608\"><colgroup><col width=\"58\" /><col width=\"61\" /><col width=\"36\" /><col width=\"30\" /><col width=\"25\" /><col width=\"26\" /><col width=\"29\" /><col width=\"39\" /><col width=\"38\" /><col width=\"45\" /><col width=\"72\" /><col width=\"62\" /><col width=\"63\" /><col width=\"42\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:58px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"58\">型号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:61px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"61\">原代号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:221px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"19\" width=\"221\" colspan=\"7\">外形尺寸<span style=\"font-family:arial\" class=\"font4\">(mm)</span></td><td