INSERT INTO `qb_reply` VALUES ('669','','0','688','54','1','1','<p>推力圆柱滚子轴承常组合成高刚度轴承配置，可以毫无困难地承受重载荷和振动载荷。这种轴承可以承受单方向很大的轴向载荷，但是不能承受径向载荷，它们没有自动调心能力。<br />推力圆柱滚子轴承可以拆分为推力圆柱滚子和保持架组件、轴圈和座圈。<br />811系列和812系列推力圆柱滚子轴承由推力圆柱滚子和保持架组件、轴圈和座圈组成，最重要的零部件是推力圆柱滚子和保持架组件。</p><table style=\"width:587px;border-collapse:collapse\" width=\"587\" height=\"623\"><colgroup><col width=\"61\" /><col width=\"59\" /><col width=\"39\" /><col width=\"35\" /><col width=\"35\" /><col width=\"76\" /><col width=\"75\" /><col width=\"74\" /><col width=\"89\" /><col width=\"44\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:61px;white-space:normal;background:#ffffff;height:53px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"53\" rowspan=\"2\" width=\"61\">型号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:59px;white-space:normal;background:#ffffff;height:53px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"53\" rowspan=\"2\" width=\"59\">原代号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:113px;white-space:normal;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"19\" width=\"113\" colspan=\"3\">外形尺寸<span style=\"font-family:arial\" class=\"font1\">(mm)</span></td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:152px;white-space:normal;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border