INSERT INTO `qb_reply` VALUES ('670','','0','689','55','1','1','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;推力圆锥滚子轴承能形成轴向非常紧凑的轴承配置，这种轴承可承受很重的轴向载荷，对冲击载荷不敏感，而且刚性好。螺钉固定轴承构成特殊设计的单向圆锥滚子推力轴承，并含满滚子。推力圆锥滚子轴承必须能够承受极大的轴向载荷，并允许螺纹轴相对于支座的角位移。因此，这种轴承通常为满滚子型，有大直径而超长的滚子。为了承受轧辊轴承箱的对中偏移而不对轴承性能产生不利影响，这种轴承有一个球面座圈。该座圈可以是轴座圈或轴承箱座圈。<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;这种轴承是定制的，以满足特定应用场合的特别要求。</p><p>&nbsp;</p><p><a href=\"http://www.sbi.com.cn/userfiles/tlyzhuigz.JPG\" target=\"_blank\"><img style=\"width:160px;float:none;height:149px\" border=\"0\" hspace=\"0\" alt=\"thrust bearings\" src=\"http://www.sbi.com.cn/userfiles/tlyzhuigz.JPG\" width=\"160\" height=\"133\" /></a><a href=\"http://www.sbi.com.cn/userfiles/thrust%20bearings2.jpg\" target=\"_blank\"><img style=\"width:160px;float:none;height:148px\" border=\"0\" hspace=\"0\" alt=\"thrust bearings\" src=\"http://www.sbi.com.cn/userfiles/thrust%20bearings2.jpg\" width=\"160\" height=\"113\" /></a><a href=\"http://www.sbi.com.cn/userfiles/thrust_bearings3.jpg\" target=\"_blank\"><img style=\"width:160px;float:none;height:149px\" border=\"0\" hspace=\"0\" alt=\"thrust bearings\" src=\"http://www.sbi.com.cn/userfiles/thrust_bearings3.jpg\" width=\"160\" height=\"134\" /></a>&nbsp;</p><table style=\"width:563px;border-collapse:collapse\" width=\"563\" height=\"380\"><colgroup><col width=\"71\" /><col width=\"47\" /><col width=\"35\" /><col width=\"35\" /><col width=\"34\" /><col width=\"42\" /><col width=\"46\" /><col width=\"49\" /><col width=\"65\" /><col width=\"90\" /><col width=\"49\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:71px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"71\">型号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#