INSERT INTO `qb_reply` VALUES ('671','','0','690','56','1','1','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;深沟球轴承主要承受径向载荷，也可同时承受径向载荷和轴向载荷。当其仅承受径向载荷时，接触角为零。当深沟球轴承具有较大的径向游隙时，具有角接触轴承的性能，可承受较大的轴向载荷&nbsp;，深沟球轴承的摩擦系数很小，极限转速也很高。深沟球轴承结构简单，与别的类型相比易于达到较高的制造精度，所以便于成系列大批量生产，&nbsp;制造成本也较低，&nbsp;使用极为普遍。深沟球轴承除基本型外，&nbsp;还有各种变型结构，如：带防尘盖的深沟球轴承，带橡胶密封圈的深沟球轴承，有止动槽的深沟球轴承，有装球缺口的大载荷容量的深沟球轴承，双列深沟球轴承。<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;深沟球轴承可用于变速箱、仪器仪表、电机、家用电器、内燃机、交通车辆、农业机械、建筑机械、工程机械、滚轴式轮滑鞋、悠悠球等.&nbsp;</p><table style=\"width:563px;border-collapse:collapse\" width=\"563\" height=\"608\"><colgroup><col width=\"71\" /><col width=\"47\" /><col width=\"35\" /><col width=\"35\" /><col width=\"34\" /><col width=\"42\" /><col width=\"46\" /><col width=\"49\" /><col width=\"65\" /><col width=\"90\" /><col width=\"49\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:71px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"71\">型号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:47px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"47\">原代号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:139px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"19\" width=\"139\" colspan=\"4\">外形尺寸<span style=\"font-family:arial\" class=\"font4\">(mm)</span></td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;