INSERT INTO `qb_reply` VALUES ('673','','0','692','58','1','1','<p>推力球轴承采用高速运转时可承受推力载荷的设计，由带有球滚动的滚道沟的垫圈状套圈构成。由于套圈为座垫形，因此，推力球轴承被分为平底座垫型和调推力球轴承hheey心球面座垫型两种类型。另外，这种轴承可承受轴向载荷，但不能承受径向载荷。<br />推力球轴承的用途：<br />只适用于承受一面轴向负荷、转速较低的机件上，例如起重机吊钩、立式水泵、立式离心机、千斤顶、低速减速器等。轴承的轴圈、座圈和滚动体是分离的，可以分别装拆。<br /></p><table style=\"width:581px;border-collapse:collapse\" width=\"581\" height=\"637\"><colgroup><col width=\"46\" /><col width=\"60\" /><col width=\"26\" /><col width=\"28\" /><col width=\"26\" /><col width=\"46\" /><col width=\"50\" /><col width=\"72\" /><col width=\"69\" /><col width=\"90\" /><col width=\"68\" /><tbody><tr height=\"50\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:46px;background:#ffffff;height:67px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et4\" height=\"67\" rowspan=\"2\" width=\"46\">型号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:60px;background:#ffffff;height:67px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et4\" height=\"67\" rowspan=\"2\" width=\"60\">原代号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:106px;background:#ffffff;height:50px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et4\" height=\"50\" width=\"106\" colspan=\"4\">外形尺寸<span style=\"font-family:arial\" class=\"font6\">(mm)</span></td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:100px;background:#ffffff;height:50px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px soli